import fetch from 'isomorphic-unfetch'

const About = (props) => {
    console.log(props)
    return (
        <div>About page</div>
    )
}



About.getInitialProps = async () => {
    const res = await fetch('https://jsonplaceholder.typicode.com/users')
    const data = await res.json()
    return { names: data }
}

export default About
